// === FINAL OVERRIDE (DATA URI): Force Level D — Items 4, 5, 6 & 7 thumbnails ===
(function() {
  const banana   = 'data:image/jpeg;base64,';
  const lemon    = 'data:image/jpeg;base64,';
  const cherry   = 'data:image/jpeg;base64,';
  const bonus    = 'data:image/jpeg;base64,';
  const question = 'data:image/png;base64,';
  function apply(level) {
    if (level !== 'D') return;
    const grid = document.querySelector('.reqs-grid');
    if (!grid) return;
    const rows = grid.children;
    // D-4 (index 3) -> banana
    if (rows[3] && banana) {
      let h = rows[3].querySelector('.thumbs'); 
      if (!h) { h=document.createElement('div'); h.className='thumbs'; rows[3].querySelector('.title-wrap').appendChild(h);}
      h.hidden=false; h.innerHTML='';
      for(let i=0;i<5;i++) h.insertAdjacentHTML('beforeend', `<div class="thumb"><img src="${banana}" alt=""></div>`);
    }
    // D-5 (index 4) -> lemon
    if (rows[4] && lemon) {
      let h = rows[4].querySelector('.thumbs'); 
      if (!h) { h=document.createElement('div'); h.className='thumbs'; rows[4].querySelector('.title-wrap').appendChild(h);}
      h.hidden=false; h.innerHTML='';
      for(let i=0;i<5;i++) h.insertAdjacentHTML('beforeend', `<div class="thumb"><img src="${lemon}" alt=""></div>`);
    }
    // D-6 (index 5) -> cherry
    if (rows[5] && cherry) {
      let h = rows[5].querySelector('.thumbs'); 
      if (!h) { h=document.createElement('div'); h.className='thumbs'; rows[5].querySelector('.title-wrap').appendChild(h);}
      h.hidden=false; h.innerHTML='';
      for(let i=0;i<5;i++) h.insertAdjacentHTML('beforeend', `<div class="thumb"><img src="${cherry}" alt=""></div>`);
    }
    // D-7 (index 6) -> 3 bonus + 2 question
    if (rows[6] && (bonus||question)) {
      let h = rows[6].querySelector('.thumbs'); 
      if (!h) { h=document.createElement('div'); h.className='thumbs'; rows[6].querySelector('.title-wrap').appendChild(h);}
      h.hidden=false; h.innerHTML='';
      for(let i=0;i<3;i++) h.insertAdjacentHTML('beforeend', `<div class="thumb"><img src="${bonus}" alt=""></div>`);
      for(let i=0;i<2;i++) h.insertAdjacentHTML('beforeend', `<div class="thumb"><img src="${question}" alt=""></div>`);
    }
  }
  if (typeof render === 'function') {
    const prev = render;
    render = function(l) { prev(l); try { apply(l); } catch(e){ console.warn(e); } };
  } else {
    document.addEventListener('DOMContentLoaded', function(){ apply('D'); });
  }
})();
// === END FINAL OVERRIDE ===
